import React from 'react';
import './App.css';
import EmbroideryCalculator from './components/EmbroideryCalculator';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Embroidery Order Form</h1>
      </header>
      <main>
        <EmbroideryCalculator />
      </main>
    </div>
  );
}

export default App;
